import Link from 'next/link';
import MyLogo from './MyLogo';

const linkStyle = {
  marginRight: 500,
};

export default Header = () => (
  <div>
    <MyLogo />
    <h2>LETIŠTĚ CHRAST</h2>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
  
   
);
